import React from "react";
import './nav.css';
import Nav from "./nav.js";


function Navigation() {
     return(
        <div className="nav">       
        <div className="navRow" key={item.section}>
            {Nav.map((item) => (
                <a href={item.href} className="navLink">{item.section}<span className="navLinkTrait">{item.separatuon}</span></a>
            ))}
        </div>
    </div> 
     )
}
export default Navigation
